import { useState } from "react";
import styled from "styled-components";

const PostList = () => {
  let posts = [
    {
      pid: 1,
      title: "첫번째 게시글입니다.",
      wname: "김산타",
      date: "2022-12-25",
    },
    {
      pid: 1,
      title: "첫번째 게시글입니다.",
      wname: "김산타",
      date: "2022-12-25",
    },
    {
      pid: 1,
      title: "첫번째 게시글입니다.",
      wname: "김산타",
      date: "2022-12-25",
    },
    {
      pid: 1,
      title: "첫번째 게시글입니다.",
      wname: "김산타",
      date: "2022-12-25",
    },
    {
      pid: 1,
      title: "첫번째 게시글입니다.",
      wname: "김산타",
      date: "2022-12-25",
    },
  ];
  return (
    <>
      <table>
        <TableHead />
        <tbody>
          <tr>
            <td>1</td>
            <td>첫번째 게시글입니다.</td>
            <td>김산타</td>
            <td>2022-12-25</td>
          </tr>
          <tr>
            <td>2</td>
            <td>두번째 게시글입니다.</td>
            <td>루돌프</td>
            <td>2022-12-25</td>
          </tr>
          <tr>
            <td>3</td>
            <td>세번째 게시글입니다.</td>
            <td>김순록</td>
            <td>2022-12-25</td>
          </tr>
          <tr>
            <td>4</td>
            <td>네번째 게시글입니다.</td>
            <td>장성탄</td>
            <td>2022-12-25</td>
          </tr>
          <tr>
            <td>5</td>
            <td>다섯번째 게시글입니다.</td>
            <td>남욱군</td>
            <td>2022-12-25</td>
          </tr>
        </tbody>
      </table>
    </>
  );
};
export default PostList;

const TableHead = () => {
  return (
    <thead>
      <tr>
        <th>글번호</th>
        <th>제목</th>
        <th>작성자</th>
        <th>등록일</th>
      </tr>
    </thead>
  );
};

const Tablerow = (props) => {
  const { pid, title, wname, date } = props;
  return (
    <tr>
      <td>{pid}</td>
      <td>{title}</td>
      <td>{wname}</td>
      <td>{date}</td>
    </tr>
  );
};
